// SearchResult.js
import React from "react";
import "./SearchResult.css";

function SearchResult() {
  return (
    <div className="searchPage">
      {/* Header */}
      <div className="searchPage_header">
        <img
          src="https://cdn.discordapp.com/attachments/1123095896989642854/1136196482597392499/Screenshot_9.png"
          alt="google logo"
          className="searchPage_logo"
        />
        <input
          type="text"
          className="searchPage_searchBar"
          placeholder="Search..."
        />
      </div>

      {/* Search Results */}
      <div className="searchPage_resultsContainer">
        {/* Left Results (60%) */}
        <div className="searchPage_resultsColumn">
          <div className="searchPage_resultBox"></div>
          <div className="searchPage_resultBox"></div>
          <div className="searchPage_resultBox"></div>
          <div className="searchPage_resultBox"></div>
        </div>

        {/* Right Results (40%) */}
        <div className="searchPage_rightResults">
          <div className="searchPage_resultBox"></div>
          <div className="searchPage_resultBox"></div>
        </div>
      </div>
    </div>
  );
}

export default SearchResult;
